import styled from "styled-components";


export const ContainerNav = styled.div`
  width: 100vw;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
  overflow: hidden;
`;

export const ImageNav = styled.img`
  width: 10%;
  height: 100%;
z
  position: absolute;
  top: 0;
  left: 0;
  z-index: -1; /* Para que o conteúdo fique sobre a imagem */
`;
